import React, {Component} from 'react';
import AOS from 'aos';
import './App.css';
import 'aos/dist/aos.css';


class App extends Component {
  constructor(props) {
    super(props);
  }

  componentDidMount() {
    AOS.init({
      duration : 2000
    })
  }

  render() {
    return (
      <Title/>
    );
  }
}


class Title extends Component {
  render() {
    console.log(window.innerHeight/2);
    return (
      <h1 data-aos="fobbe" data-aos-anchor-placement="center-center" className="Title">MAGDALEN BALL</h1>
    );
  }
}


export default App;
